import React from "react";
import { useNavigate } from "react-router-dom";
import bannerImage from "./bg.png";
import "./DashboardPage.css";


function DashboardPage() {
    const navigate = useNavigate();

    return (
        <div>
                  {/* Image Banner */}
                  <div
                style={{
                    width: "100%",
                    height: "300px",
                    overflow: "hidden",
                    marginBottom: "0px",
                }}
            >
                <img
                    src={bannerImage} // Replace this URL with your image URL
                    alt="Banner"
                    style={{
                        width: "100%",
                        height: "100%",
                        objectFit: "cover",
                    }}
                />
            </div>    

            {/* Navigation Bar */}
            <div
                style={{
                    display: "flex",
                    backgroundColor: "red",
                    width: "100%",
                    height: "60px",
                    alignItems: "center",
                }}
            >
                <button
                    style={{
                        flex: 1,
                        height: "100%",
                        backgroundColor: "darkred",
                        color: "white",
                        border: "none",
                        fontSize: "18px",
                        cursor: "pointer",
                    }}
                    onClick={() => navigate("/calview")}
                >
                    Calendar View
                </button>
                <button
                    style={{
                        flex: 1,
                        height: "100%",
                        backgroundColor: "darkred",
                        color: "white",
                        border: "none",
                        fontSize: "18px",
                        cursor: "pointer",
                    }}
                    onClick={() => navigate("/addevent")}
                >
                    Add Event
                </button>
                <button
                    style={{
                        flex: 1,
                        height: "100%",
                        backgroundColor: "darkred",
                        color: "white",
                        border: "none",
                        fontSize: "18px",
                        cursor: "pointer",
                    }}
                    onClick={() => navigate("/")}
                >
                    Sign Out
                </button>
            </div>

            {/* Main Dashboard Content */}
            <div style={{ padding: "20px" }}>
                <button onClick={() => navigate("/updateevent")}>Go to Update Event</button>
                <button onClick={() => navigate("/")}>Back to Home</button>
            </div>
        </div>
    );
}

export default DashboardPage;
